import React, { useState } from "react"
import "./index.css"
 const App = ()=>{
     let [Inputitem,Setinput]=useState("")
     let [items,Setitem] =useState([])
     const Set =(e)=>{
       Setinput(e.target.value)
     }
     function Listofitem(){
    Setitem( olditem =>{
        return [...olditem,Inputitem]
    })

     }
     return (
         <>
        <div className="main">
            <div className="cnt">
                <h1>todo <span> list </span></h1>
                <br />
                <input type="text" placeholder="add a item" onChange={Set}/>
                <button onClick={Listofitem}>+</button>
                <ol>
                    {
                        items.map( itm =>{
                            return <li>{itm} </li>
                        })
                    }
                </ol>
            </div>

        </div>

         </>
     )
 }



 export default App;
